import React from 'react';
import {BrowserRouter as Router,Route,Link,Switch} from 'react-router-dom';
import Home from './Components/HomeComponent/HomeComponent';
class App extends React.Component {
    render(){
        return(
<div>
<BrowserRouter>
        <Switch>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>

        );
    }
    }export default App;
